export const AUTH_LOGIN = (action) => {
    return (dispatch) => {
        dispatch({
            type: "LOGIN",
            user: action.user
        })
    }
}

export const AUTH_LOGOUT = (action) => {
    return (dispatch) => {
        dispatch({
            type: "LOGOUT",
            user: null 
        })
    }
}
